import React, {useState } from 'react'
import { Link } from 'react-router-dom'
import {Button, Label, Menu} from 'semantic-ui-react'

const NavBar = (props) => {
  /* this is a handler for a navbar link item */
   const [activeItem,setActiveItem] = useState({
     name:'home'
   })

   const handleItemClick =(e,{name})=>{
     setActiveItem(name)
   }

    return (
        <div >
            <Menu 
            fixed='top'
            size='large'
            color='teal' 
            pointing 
            widths='12'
            borderless
           >

            <Menu.Item
              active={activeItem ==='home'}
              onClick={handleItemClick}
              as={Link}
              to={'/'}
            >
              KirayBet.com
            </Menu.Item>
            <Menu.Item
              color='red'
              active={activeItem === 'about'}
              onClick={handleItemClick}
              as={Link}
              to={'/about'}
            >
              Tenant Screen
            </Menu.Item>
            <Menu.Item
              name='help'
              active={activeItem === 'help'}
              onClick={handleItemClick}
              as={Link}
              to={'/help'}
            >
            Rent Pay
            </Menu.Item>
            <Menu.Item
              name='help'
              active={activeItem === 'help'}
              onClick={handleItemClick}
              as={Link}
              to={'/help'}
            >
            Other Services
            </Menu.Item>
            <Menu.Item
              name='help'
              active={activeItem === 'help'}
              onClick={handleItemClick}
              as={Link}
              to={'/help'}
            >
            help
            </Menu.Item>
            <Menu.Menu position='right'>
            <Menu.Item >
                <Link>
                List Propery
                </Link>
                      <Button as='a' primary={props.fixed} style={{ marginLeft: '0.5em' }}>
                        Sign Up
                      </Button>
                      <Button as='a' primary={props.fixed} style={{ marginLeft: '0.5em' }}>
                        Sign Up
                      </Button>
                      <Button as='a' primary={props.fixed} style={{ marginLeft: '0.5em' }}>
                        Sign Up
                      </Button>
            </Menu.Item>
            </Menu.Menu>
           </Menu>

        </div>
    )
}

export default NavBar
